import styled from 'styled-components';

export const Main = styled.main`{  
    max-height: 90vw;
    scroll-snap-type: y mandatory;  
    background-color: var(--black);
    color: var(--grayLight);
    padding-top: 10vh;
    overflow-y: scroll;
}
`;
